import React from 'react';

const Contact = () => {
  return (
    <div className="container my-5">
      {/* Header */}
      <section className="text-center my-5">
        <h1>Contact Us</h1>
        <p className="lead">
          We'd love to hear from you! Please fill out the form below or contact us through our social media.
        </p>
      </section>

      {/* Contact Form */}
      <section className="row justify-content-center my-5">
        <div className="col-md-8">
          <form>
            <div className="mb-3">
              <label htmlFor="name" className="form-label">Full Name</label>
              <input type="text" className="form-control" id="name" placeholder="Your Name" required />
            </div>
            <div className="mb-3">
              <label htmlFor="email" className="form-label">Email Address</label>
              <input type="email" className="form-control" id="email" placeholder="name@example.com" required />
            </div>
            <div className="mb-3">
              <label htmlFor="subject" className="form-label">Subject</label>
              <input type="text" className="form-control" id="subject" placeholder="Subject" required />
            </div>
            <div className="mb-3">
              <label htmlFor="message" className="form-label">Message</label>
              <textarea className="form-control" id="message" rows="5" placeholder="Your message here..." required></textarea>
            </div>
            <button type="submit" className="btn btn-primary w-100">Send Message</button>
          </form>
        </div>
      </section>

      {/* Map Section */}
      <section className="text-center my-5">
        <h2>Our Location</h2>
        <p className="lead">1234, Example Street, City, Country</p>
        <div className="my-3">
          {/* <iframe
            title="Location Map"
            src="https://maps.app.goo.gl/rNdK1qU9o2q4oKyS9"
            width="100%"
            height="400"
            style={{ border: 0 }}
            allowFullScreen=""
            loading="lazy"
          ></iframe> */}
          <iframe src="https://www.google.com/maps/embed?pb=!3m2!1sen!2sin!4v1731438117931!5m2!1sen!2sin!6m8!1m7!1sA6uuHce_kIt3iUAxt4eHRw!2m2!1d18.0463737863211!2d78.26244443018427!3f23.81893707933326!4f4.076556343854591!5f0.7820865974627469" width="400" height="300" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
        </div>
      </section>
    </div>
  );
};

export default Contact;
